
-- Listage de la structure de la base pour biblivres
CREATE DATABASE IF NOT EXISTS `biblivres`;
USE `biblivres`;

-- Listage de la structure de table biblivres. Admin
CREATE TABLE IF NOT EXISTS `Admin` (
  `Id_admin` int(11) NOT NULL AUTO_INCREMENT,
  `email` varchar(255) NOT NULL DEFAULT '',
  `Password` varchar(255) NOT NULL DEFAULT '',
  PRIMARY KEY (`Id_admin`)
) ENGINE=InnoDB AUTO_INCREMENT=2 ;

-- Listage de la structure de table biblivres. Adresse
CREATE TABLE IF NOT EXISTS `Adresse` (
  `Id_adresse` int(11) NOT NULL AUTO_INCREMENT,
  `Id_client` int(11) NOT NULL DEFAULT 0,
  `Pays` varchar(255) NOT NULL DEFAULT '',
  `Adresse` varchar(255) NOT NULL DEFAULT '',
  `Complement` varchar(255) NOT NULL DEFAULT '',
  `Ville` varchar(255) NOT NULL DEFAULT '',
  `Code_postal` varchar(5) NOT NULL DEFAULT '0',
  PRIMARY KEY (`Id_adresse`),
  KEY `FK_Adresse_livraison_Clients` (`Id_client`),
  CONSTRAINT `FK_Adresse_livraison_Clients` FOREIGN KEY (`Id_client`) REFERENCES `Clients` (`Id_client`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=10 ;

-- Listage de la structure de table biblivres. Article_commande
CREATE TABLE IF NOT EXISTS `Article_commande` (
  `Id_article_commande` int(11) NOT NULL AUTO_INCREMENT,
  `Id_commande` int(11) NOT NULL DEFAULT 0,
  `Id_livre` int(11) DEFAULT 0,
  `Quantity_buy` int(11) NOT NULL DEFAULT 1,
  PRIMARY KEY (`Id_article_commande`),
  KEY `FK_Article_commande_Comandes` (`Id_commande`),
  KEY `FK_Article_commande_Livres` (`Id_livre`),
  CONSTRAINT `FK_Article_commande_Comandes` FOREIGN KEY (`Id_commande`) REFERENCES `Commandes` (`Id_commande`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `FK_Article_commande_Livres` FOREIGN KEY (`Id_livre`) REFERENCES `Livres` (`Id_Livre`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=31 ;

-- Listage de la structure de table biblivres. Article_panier
CREATE TABLE IF NOT EXISTS `Article_panier` (
  `Id_article_panier` int(11) NOT NULL AUTO_INCREMENT,
  `Id_client` int(11) NOT NULL DEFAULT 0,
  `Id_livre` int(11) NOT NULL DEFAULT 0,
  `quantity` int(11) NOT NULL DEFAULT 1,
  PRIMARY KEY (`Id_article_panier`),
  KEY `client_panier` (`Id_client`),
  KEY `livre_panier` (`Id_livre`),
  CONSTRAINT `client_panier` FOREIGN KEY (`Id_client`) REFERENCES `Clients` (`Id_client`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `livre_panier` FOREIGN KEY (`Id_livre`) REFERENCES `Livres` (`Id_Livre`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=62 ;

-- Listage de la structure de table biblivres. Article_souhait
CREATE TABLE IF NOT EXISTS `Article_souhait` (
  `Id_article_souhait` int(11) NOT NULL AUTO_INCREMENT,
  `Id_client` int(11) NOT NULL DEFAULT 0,
  `Id_livre` int(11) NOT NULL DEFAULT 0,
  PRIMARY KEY (`Id_article_souhait`),
  KEY `Id_client` (`Id_client`),
  KEY `livre_souhait` (`Id_livre`),
  CONSTRAINT `client_souhait` FOREIGN KEY (`Id_client`) REFERENCES `Clients` (`Id_client`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `livre_souhait` FOREIGN KEY (`Id_livre`) REFERENCES `Livres` (`Id_Livre`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=33 ;

-- Listage de la structure de table biblivres. Auteur
CREATE TABLE IF NOT EXISTS `Auteur` (
  `Id_Auteur` int(10) NOT NULL AUTO_INCREMENT,
  `Nom` varchar(255) NOT NULL,
  `profil` longblob NOT NULL,
  `Nationalite` varchar(255) NOT NULL,
  `Mort` tinyint(1) NOT NULL DEFAULT 0,
  `Epoque` varchar(255) NOT NULL,
  `Courant` enum('Naturalisme','Romantisme','Humanisme','Symbolisme') NOT NULL DEFAULT 'Naturalisme',
  `Nombres_Oeuvres` int(10) NOT NULL DEFAULT 0,
  `Moyenne_Prix` float NOT NULL DEFAULT 0,
  PRIMARY KEY (`Id_Auteur`)
) ENGINE=InnoDB AUTO_INCREMENT=15 ;

