-- Listage de la structure de table biblivres. Clients
CREATE TABLE IF NOT EXISTS `Clients` (
  `Id_client` int(11) NOT NULL AUTO_INCREMENT,
  `Nom` varchar(255) NOT NULL DEFAULT '',
  `Prenom` varchar(255) NOT NULL DEFAULT '',
  `Email` varchar(255) NOT NULL DEFAULT '',
  `Password` varchar(255) NOT NULL DEFAULT '',
  `Num_tel` varchar(50) NOT NULL DEFAULT '0',
  PRIMARY KEY (`Id_client`)
) ENGINE=InnoDB AUTO_INCREMENT=20 ;

-- Listage de la structure de table biblivres. Commandes
CREATE TABLE IF NOT EXISTS `Commandes` (
  `Id_commande` int(11) NOT NULL AUTO_INCREMENT,
  `Id_client` int(11) NOT NULL DEFAULT 0,
  `Id_adresse` int(11) NOT NULL DEFAULT 0,
  `date_heure_commande` datetime NOT NULL,
  `Prix_total` float NOT NULL DEFAULT 0,
  PRIMARY KEY (`Id_commande`),
  KEY `FK_Comandes_Adresse_livraison` (`Id_adresse`) USING BTREE,
  KEY `client_commande` (`Id_client`),
  CONSTRAINT `FK_Comandes_Adresse` FOREIGN KEY (`Id_adresse`) REFERENCES `Adresse` (`Id_adresse`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `client_commande` FOREIGN KEY (`Id_client`) REFERENCES `Clients` (`Id_client`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=15 ;

-- Listage de la structure de table biblivres. Genre
