-- Listage de la structure de table biblivres. Livres
CREATE TABLE IF NOT EXISTS `Livres` (
  `Id_Livre` int(10) NOT NULL AUTO_INCREMENT,
  `Titre_Livre` varchar(255) NOT NULL,
  `Miniature` longblob NOT NULL DEFAULT '',
  `Intrigue` varchar(2000) NOT NULL,
  `Id_Langue` int(10) NOT NULL DEFAULT 0,
  `Date_Publi` date NOT NULL,
  `Id_Auteur` int(10) NOT NULL DEFAULT 0,
  `Id_Genre` int(10) NOT NULL DEFAULT 0,
  `Id_Types` int(10) NOT NULL DEFAULT 0,
  `Prix` float NOT NULL DEFAULT 0,
  `Nb_Pages` int(10) NOT NULL,
  `Editeur` varchar(255) NOT NULL,
  `Quantity` int(10) NOT NULL DEFAULT 1,
  PRIMARY KEY (`Id_Livre`),
  KEY `FK_Livres_Auteur` (`Id_Auteur`),
  KEY `Genre` (`Id_Genre`),
  KEY `Langue` (`Id_Langue`),
  KEY `Types` (`Id_Types`),
  CONSTRAINT `FK_Livres_Auteur` FOREIGN KEY (`Id_Auteur`) REFERENCES `Auteur` (`Id_Auteur`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `Genre` FOREIGN KEY (`Id_Genre`) REFERENCES `Genre` (`Id_Genre`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `Langue` FOREIGN KEY (`Id_Langue`) REFERENCES `Langue` (`Id_Langue`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `Types` FOREIGN KEY (`Id_Types`) REFERENCES `Types` (`Id_Types`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=25 ;

