	(6, 'Game Over', _binary , 'Quand Kid Paddle, Big Bang et Horace s&#039;enferment pour passer la nuit à jouer sur leur console de jeu, on se doute qu&#039;ils vont vivre quelques heures particulièrement éprouvantes. Au menu : TOUS les jeux dont le petit barbare est le héros. Des heures de str', 1, '2004-11-01', 7, 5, 1, 13.03, 48, 'Dupuis', 10),
